export function addNumbers(n1,n2){
    // console.log('valor s1:',n1);
    // console.log('valor s2:',n2);
    return{
        type:"ADD_NUMBERS",
        payload:[n1,n2]
    };
}

export function multiplyNumbers(n1,n2){
    // console.log('valor m1:',n1);
    // console.log('valor m2:',n2);
    return{
        type:"MULTIPLY_NUMBERS",
        payload:[n1,n2]
    };
}
